// redux/actions/authActions.js

// redux/actions/authActions.js

export const loginSuccess = (userDetails) => {
    return {
      type: 'LOGIN_SUCCESS',
      payload: userDetails, // Assuming userDetails contain token, user information, etc.
    };
  };
  
  export const logout = () => {
    return {
      type: 'LOGOUT',
    };
  };
